import React from "react";
import logo from "./logo.js";
import "./logo.css";
import { Link } from "react-router-dom";
import HeartSvg from "./heart.svg";
import BasketSvg from "./basket.svg";
import { useSelector} from "react-redux";

function Logo() {
    const cart = useSelector((store) => store.cart);

    return (
        <div className="logo"> 
            {logo.map((item) =>(    
                <div className="logoRow"  key = {logo.svg}>                    
                    <div className="logoIcon"> 
                        <Link to="/">                
                            <img src={item.image} alt="logo" className="logoImg" />
                        </Link>
                    </div>
                    
                    <Link to="/">
                        <div className="logoName">
                            <p className="logoText">Мой</p>
                            <p className="logoTextCont">Маркет</p>      
                        </div> 
                    </Link> 

                    <div class="logoHeart">

                        <div className={`logoHeartNumberHidden ${cart.products ? "" : `logoHeartNumber`} `}>1</div>                             
                        <HeartSvg />
                    </div>

                    <div class="logoBasket">
                        
                        <div className = {`logoBasketNumberHidden ${cart.products ? "" : `logoBasketNumber` }`}>1</div>
                        <BasketSvg />
                    </div>
                </div>
                ))}                                       
        </div>
    )
}

export default Logo
